Defendant in custody.
The defendant is sentenced to the Wisconsin State Prison System for a total of three (3) years.  That is eighteen (18) months initial confinement followed by eighteen (18) months extended supervision.
The Court finds the defendant eligible for the Substance Abuse Program. She is not eligible for the Challenge Incarceration Program.
The defendant has credit for 67 days.
Conditions of extended supervision:
1) Pay court costs including $130.00 to Metro Drug, for a total of $648.00;
2) pay supervision fees in an amount to be determined by DOC;
3) AODA assessment and follow through;
4) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
5) Maintain absolute sobriety;
6) Defendant is to have no contact with any known drug dealers or users;
7) Defendant is to use only one doctor to prescribe medications and only one pharmacist to dispense medications unless approved by the agent.
Minutes.
